import React from 'react';
import pic01 from '../images/room1.jpeg'
import pic02 from '../images/room2.webp'
import pic03 from '../images/room3.webp'
import './Slider.css'; // Create a CSS file for styling if needed


const Feature = (feature) => {
  return (
    <div className="col-4 col-12-medium" style={{margin: '20px', animation: "fade 1s linear infinite"}}>
      <section className="box feature">
        {/* Add inline styles to the image tag */}
        <a href="#" className="image featured">
          <img src={feature.pic} alt="" style={{ width: '100%', height: '200px', objectFit: 'cover'}} />
        </a>
        <div className="inner">
          <header>
            <h2> {feature.address} </h2>
            <p>{feature.price}</p>
          </header>
          <p>{feature.description}</p>
        </div>
      </section>
    </div>

  );
};

export default Feature;
